    class Program
    {
        static void Main(string[] args)
        {
            // Create a list of cameras
            List<Camera> cameras = new List<Camera>();

            // Add cameras to the list
            cameras.Add(new Camera("Camera 1", "Front Door"));
            cameras.Add(new Camera("Camera 2", "Back Door"));
            cameras.Add(new Camera("Camera 3", "Garage"));
            cameras.Add(new Camera("Camera 4", "Driveway"));

