        public string Name { get; set; }
        public string Location { get; set; }

        public Camera(string name, string location)
        {
            Name = name;
            Location = location;
        }

        public void Control()
        {
            Console.WriteLine("Controlling " + Name + " at " + Location);
        }
    }
