// Function to get IP address from hostname
string getIPFromHostname(string hostname)
{
    struct hostent *he;
    struct in_addr **addr_list;
    int i;
    string ip = "";

    if ( (he = gethostbyname( hostname.c_str() ) ) == NULL) 
    {
        herror("gethostbyname");
        return "";
    }

    addr_list = (struct in_addr **) he->h_addr_list;

    for(i = 0; addr_list[i] != NULL; i++) 
    {
        ip = inet_ntoa(*addr_list[i]);
    }

    return ip;
}

// Function to get hostname from IP address
string getHostnameFromIP(string ip)
{
    struct sockaddr_in sa;
    char hostname[1024];

    sa.sin_family = AF_INET;
    inet_pton(AF_INET, ip.c_str(), &(sa.sin_addr));

    if (getnameinfo((struct sockaddr *)&sa, sizeof(sa), hostname, sizeof(hostname), NULL, 0, 0) != 0)
    {
        return "";
    }

    return hostname;
}

